import React from 'react';
import { useAuth0 } from '@auth0/auth0-react';

const LoginButton = () => {
  const { loginWithRedirect,  user } = useAuth0();
  return (
    <button className="button-52" onClick={() => loginWithRedirect()}>
      Log In
    </button>
  );
};

export default LoginButton;
